const port = 4159
const prefix = `http://localhost:${port}/`

export const fetch_data = async (method,...params) => {
    const url = `${prefix}${method}`
    console.log(url,data)
    const response = await fetch(url, {
        method: 'POST',
        data:params
    })
    const data = await response.json()
    return data
}
